openapi: 3.0.3
info:
  title: My API
  version: 1.0.0
servers:
  - url: http://192.168.1.7:3000
    description: Local Swagger Mock API
paths:
  /data:
    get:
      summary: Get all data
      description: Returns all mock data defined in /src/data directory.
      responses:
        '200':
          description: OK
          content:
            application/json:
              examples:
                MEMO_DATA:
                  $ref: '#/components/examples/MEMO_DATA'
                PROFILE_DATA:
                  $ref: '#/components/examples/PROFILE_DATA'
                PROJECT_DATA:
                  $ref: '#/components/examples/PROJECT_DATA'
                RECORD_DATA:
                  $ref: '#/components/examples/RECORD_DATA'
                TRACK_DATA:
                  $ref: '#/components/examples/TRACK_DATA'
  /data/memo:
    get:
      summary: Get memo data
      description: Returns mock data for MEMO_DATA.
      operationId: getMEMO
      responses:
        '200':
          description: OK
          content:
            application/json:
              examples:
                MEMO_DATA:
                  $ref: '#/components/examples/MEMO_DATA'
  /data/profile:
    get:
      summary: Get profile data
      description: Returns mock data for PROFILE_DATA.
      operationId: getPROFILE
      responses:
        '200':
          description: OK
          content:
            application/json:
              examples:
                PROFILE_DATA:
                  $ref: '#/components/examples/PROFILE_DATA'
  /data/project:
    get:
      summary: Get project data
      description: Returns mock data for PROJECT_DATA.
      operationId: getPROJECT
      responses:
        '200':
          description: OK
          content:
            application/json:
              examples:
                PROJECT_DATA:
                  $ref: '#/components/examples/PROJECT_DATA'
  /data/record:
    get:
      summary: Get record data
      description: Returns mock data for RECORD_DATA.
      operationId: getRECORD
      responses:
        '200':
          description: OK
          content:
            application/json:
              examples:
                RECORD_DATA:
                  $ref: '#/components/examples/RECORD_DATA'
  /data/track:
    get:
      summary: Get track data
      description: Returns mock data for TRACK_DATA.
      operationId: getTRACK
      responses:
        '200':
          description: OK
          content:
            application/json:
              examples:
                TRACK_DATA:
                  $ref: '#/components/examples/TRACK_DATA'
